drop table cards if exists;
drop table fusions if exists;

CREATE TABLE fusions (
	fusion_id int(11) NOT NULL AUTO_INCREMENT,
	monster int(11) DEFAULT NULL,
	material_1 int(11) DEFAULT NULL,
	material_2 int(11) DEFAULT NULL,
	PRIMARY KEY (fusion_id)
);

CREATE TABLE cards (
	id int(11) NOT NULL AUTO_INCREMENT,
	name varchar(50) DEFAULT NULL,
	card_type int(11) DEFAULT NULL,
	monster_type int(11) DEFAULT NULL,
	card_level int(11) DEFAULT NULL,
	atk int(11) DEFAULT NULL,
	def int(11) DEFAULT NULL,
	cost int(11) DEFAULT NULL,
	PRIMARY KEY (id)
);



